// SPDX-License-Identifier: MIT
pragma solidity ^0.8.7;

import "./createCollection.sol";

contract Exibit {
    // ** User ** //

    // On user creation
    event UserCreated(
        address uAddress,
        string name,
        string image,
        string twitterUrl,
        string websiteUrl
    );

    // Create/Update user profile
    function createUser(
        string memory name_,
        string memory image_,
        string memory twitterUrl_,
        string memory websiteUrl_
    ) public {
        // Map User to address
        // users[msg.sender] = User(name_, metadata_);

        // Log event to subgraph
        emit UserCreated(msg.sender, name_, image_, twitterUrl_, websiteUrl_);
    }

    // ** Custom Collection ** //

    // On collection creation
    event CollectionCreated(
        address cAddress,
        string name,
        string image,
        address creator,
        string metadata
    );

    // Create and List collection on marketplace
    function createCollection(
        string memory name_,
        string memory symbol_,
        string memory image_,
        string memory metadata_
    ) public {
        address cAddress = address(
            new CreateCollection(name_, symbol_, metadata_, msg.sender)
        );

        // Log event to subgraph
        emit CollectionCreated(cAddress, name_, image_, msg.sender, metadata_);
    }

    // To buy fixed price nfts
    function marketPlaceTransferFrom(
        address cAddress,
        address nftOwner,
        address newOwner,
        uint256 tokenId
    ) public {
        // Check if caller is collection
        require(
            msg.sender == cAddress,
            "Marketplace : marketPlaceTransferFrom -> Caller is not contract"
        );

        CreateCollection(cAddress).safeTransferFrom(
            nftOwner,
            newOwner,
            tokenId
        );
    }

    // To receive ether
    // Function to receive Ether. msg.data must be empty
    receive() external payable {}
}
